RecipeInstructions:
c("CAKE:  Grease 5 cup heart shaped pan; dust with unsweetened cocoa", "powder and set aside.  In bowl, blend together brown sugar, butter and vanilla; add eggs, one at a time, beating well with wooden spoon after each addition.", "Sift together flour, cocoa and salt; add all at once to creamed mixture, mixing just until blended.", "Stir in nuts; spread in prepared pan.", "Loosely cover tip of heart with foil to prevent from drying out. Bake in 350xF oven for 35 to 40 minutes or until just barley firm to the touch.", 
"Let cool in pan for 10 minutes; turn out onto rack and let cool completely.", "FROSTING:  In top of double boiler over hot, not boiling, water, melt white chocolate with butter.", "(Alternatively, in microwaveable dish, microwave at Medium/50% for 1 to 2 minutes or until softened.)  Remove from heat and let cool slightly; stir in sour cream until smooth and blended.", "Refrigerate for 10 minutes; spread smoothly over sides then top of cooled cake. GARNISH:  Sprinkle cocoa in attractive pattern on top of cake. Arrange almonds around top edge."
)

c("Place ONE cup each sugar, milk, and flour in large glass or plastic bowl.", "Cover lightly with plastic wrap and set on your counter at room temperature. Stir with a wooden spoon everyday for 17 days.", "On day 18 do nothing.", "On days 19, 20, and 21, stir.", "On day 22, add 1 cup sugar, 1 cup milk, and 1 cup flour, and stir again.", "On days 23, 24, 25, and 26 stir.", "On day 27, add 1 cup milk, 1 cup flour, and 1 cup sugar and stir.", "It's now ready to use to make the bread.", "Give away two cups of the starter to two friends, use one to make the bread, and keep one to keep the starter going.  When you give away a cup of the starter, give these directions for keeping it going:  Do not refrigerate; Do not use metal spoon or metal bowl; Do not cover tightly, cover loosely with plastic wrap.", 
"AMISH FRIENDSHIP BREAD:  Mix oil, eggs, and vanilla with the starter mix.", "In a separate bowl, mix flour, sugar, baking powder, cinnamon, salt, baking soda, vanilla pudding mix, and nuts.", "Add to liquid mixture and stir thoroughly.", "Pour into two large well-greased 9x5 inch loaf pans, or one Bundt pan, that have been sprinkled with a mixture of cinnamon, sugar, and flour.", "Sprinkle more cinnamon and sugar on the tops of the unbaked loaves (or cake).  Bake at 325F for one hour or until done."
)

c("Preheat oven to 350 degrees Fahrenheit.", "In saucepan, combine whipping cream, butter and  sugar.", "Bring to a boil, stirring constantly.", "Remove from heat.", "Add candied fruit, candied orange, almond slivers, ground almonds, and flour, one after the other to cream, mixing well.", "Drop by teaspoonfuls onto greased cookie sheet, leaving several inches space in between.", "With fork, dipped in water, press dough to approx 5 cm  (2 inches diameter) rounds.", "Bake 5 to 6 minutes.", "Carefully remove and cool on  rack.", 
"In the meantime, for the glaze, melt the grated chocolate with water in double boiler or in microwave.", "After cookies have cooled, brush glaze onto smooth bottom side of  cookies.", "Before glaze hardens, make a pattern by moving a fork across glaze.", "Die Florentiner im 180 oC heissen Ofen 5 bis 6 Minuten backen.", "Mit einem  Spatel vom Blech loesen und auf einem Kuchengitter abkuehlen lassen.", "Inzwischen die feingeriebene Zartbitterschokolade mit dem Wasser  vermischen und im heissen Wasserbad schmelzen."
)

c("Pat loaves together.", "On a lightly floured board, roll dough into a 12\" x18\"  rectangle.", "Garlic Oil: Combine 3 tablespoons olive oil with 2 cloves garlic, minced or  pressed and 1/2 teaspoon each dry basil leaves, dry oregano leaves and dry thyme  leaves. Brush surface with 2 tablespoons garlic oil.", "Cover half dough lengthwise with overlapping layers of salami, ham, coppa, cheese, onions and  peppers.", "Lift plain half of dough over filling (if dough sticks, loosen with a  spatula). Press edges firmly together to seal.", 
"Using 2 wide spatulas, transfer  packet to an oiled 12\" x17\" baking sheet; tuck ends of dough under.", "Brush with remaining oil.", "Let rise in a warm place until puffy, about 20 minutes.", "Bake at 400 degrees Fahrenheit until richly browned, 15 to 20 minutes.", "Cut sandwich lengthwise in half then  crosswise into 3\" slices.", "Grilled Onion: In an 8-10\" frying pan over medium high heat, combine 1 tablespoon olive oil, 2 tablespoons balsamic or red wine vinegar and 1 large onion, sliced. Stir often, until onion begins to brown, 8 to 10 minutes; set aside."
)

c("Heat oven to 350 degrees Fahrenheit.", "Spray cookie sheets with nonstick cooking spray.", "In  medium bowl, combine flour, cocoa and baking powder; mix well.", "In large bowl, combine sugar, brown sugar and butter; beat until blended.", "Add eggs; beat well.", "Add flour mixture; mix well.", "Stir in vanilla chips.", "With sprayed hands, shape dough into three 7\" rolls.", "Place rolls 3\" apart on sprayed cookie sheet; flatten  each to 7\" x 3\" rectangle.", "Bake at 350 degrees Fahrenheit for 22 to 28 minutes or until set and light  golden brown.", 
"Remove from cookie sheet; place on wire racks.", "Cool 5 minutes.", "With serrated knife, cut rectangles into 1/2\" slices.", "Arrange slices, cut side up, on  ungreased cookie sheet.", "Bake at 350 degrees Fahrenheit for 6 to 8 minutes or until top surface is  slightly dry.", "Turn cookies over; bake an additional 6 to 8 minutes or until top surface is slightly dry.", "Remove from cookie sheets; cool 15 minutes or until  completely cooled.", "Store in tightly covered container.", "NOTES : Ingredient substitution: Use semi-sweet or milk chocolate chips in  place of the vanilla chips."
)

c("Lightly grease a large cookie sheet. Set aside. In a large mixing bowl beat  butter with an electric mixer on med. speed for 30 sec.", "Add sugar, cocoa powder and baking powder & beat until combined.", "Beat in eggs.", "Beat in as much of the flour as you can.", "Using a spoon, stir in any remaining flour, white baking bar and semisweet chocolate. Divide dough in half.", "Shape each half into a 9\" long log.", "Place log about 4\" apart on prepared cookie sheet. Flatten logs slightly until about 2\" thick.", 
"Bake logs in a 375 degree oven for 20-25 min. or until a wooden toothpick inserted neat the centers comes out clean.", "Cool on the cookie sheet set on a wire rack for 1 hour.", "Using a serrated knife, cut each log diagonally into 1/2\" thick slices.", "Lay slices, cut side down, on ungreased cookie sheets.", "Bake slices in a 325 degree oven for 8 min.", "Turn slices over.", "Bake 7-9 min. more or until slices are dry and crisp. (Do not overbake.)", "Transfer to wire racks and let cool.", "Store in an airtight container at room temperature for up to 1 week or freeze for up to 3 months."
)

c("Preheat oven to 325 degrees.", "Butter sides and bottom of 13x9\" baking pan.", "Butter one side of each bread slice and layer in pan alternately with croissants (6 slices bread, croissant slices, 6 slices bread). In large bowl with an electric mixer set on med-high speed, beat eggs until slightly thickened, about 5 min.", "Add sugar and vanilla and beat at med.", "speed until thoroughly combined.", "reduce speed to low and add cream; mix until smooth.", "Pour egg-cream mixture over bread and croissant slices.", 
"the slices will absorb egg-cream mixture slowly, so continue adding liquid until all is in pan.", "In small bowl combine cinnamon, nutmeg and 1/8 teaspoon sugar.", "Sprinkle sugar-spice mixture over the bread pudding.", "Fill a baking pan larger than the 13x9\" bread pudding pan halfway up with hot water.", "Place in oven, set bread pudding pan in the water bath.", "Bake 45-50 min.", "or until custard is set. When set, remove the bread pudding from the oven, and discard water in larger pan.", "Cool to room temperature. refrigerate for 2 hours or until firm."
)

c("Oven to 350 degrees.", "Lightly grease a large cookie sheet. In a food processor,  process flour, sugar, lime peel and baking powder until blended.", "Add butter and  cherries.", "Pulse until cherries are coarsely chopped.", "Spoon off and reserve 1  tablespoon of beaten eggs.", "Add remaining eggs and pistachios and pulse until  dough is evenly moistened.", "Turn dough out onto on a well-floured surface.(Dough  will be sticky). Divide dough in 1/4s.", "With hands, roll each portion into a 9\"  log.", 
"Place logs crosswise 3\" apart on prepared baking sheet. Press logs to  flatten to 2\" wide. Brush with reserved egg.", "Bake 25 min.  or until golden brown.", "Let cool on sheet on a wire rack 10 min.", "Loosen with a spatula and remove to a  cutting board.", "Let cool 10 min.  longer.", "Using a large heavy knife, cut each log  diagonally in 1/2\" thick slices.", "Arrange slices upright on clean cookie sheet  (no need to grease sheet). Bake 14-16 min.", "longer until crisp.", "Remove to wire  rack to cool (cookies will get even more crisp).   - - - - - - - - - - - - - - - - - -"
)

c("Wash 15 pounds of tart apples and quarter without peeling.", "Place in a preserving   pan, just cover with cold water, and simmer gently until soft and tender.", "Drain  through a jelly bag.", "Shift the pulp gently occasionally to keep the juice  flowing; do not force the juice through as this will make the jelly cloudy.", "Measure 32 fluid ounces of juice into a 12-quart pan and boil for 5 minutes.", "Add  the sugar and boil for 5 to 8 minutes longer, or until a drop jells on a cold  plate. Pour into hot clean jars and seal.", 
"Continue cooking 32 fluid ounces at a  time until all the juice has been used.", "Use the pulp for making an apple cheese.", "MINT APPLE JELLY: Cook a few sprigs of fresh mint with the apples when  preparing to extract the juice. [1 or 2 drops of mint sauce may be  used if fresh mint is not available.]  Add a few drops of green food colouring and mint sauce just before  pouring into the jars.  Avoid adding too much flavouring and colouring.", "SPICED APPLE JELLY: Tie a few whole cloves in a piece of muslin.  Drop  into the juice at the beginning of cooking and only remove when jelly  is poured into the jars."
)

c("Equipment:", "1 mold pan", "1 Angel food or Bundt cake pan", "1 Clear glass plate", "1 Small flashlight (I am also thinking you can buy one of those small safety flash red strobe-type lights for night use   the kind that uses the AAA batteries. I have a small one that I use on my bike that may be appropriate for this kind of dish)", "Prepare the gelatin according to package directions and pour into mold or a big  plastic bowl.", "Take a Bundt cake pan or any angel food cake pan with a hollow  cylinder center where you can insert a small flashlight.  Unmold the gelatin  onto the clear glass plate and place the plate atop the cake pan with the  flashlight underneath, standing up.", 
"Turn out the lights!  For extra special  effect, you can put the blinking red strobe light under another small  transparent glass dish or plastic wrap and put that under the gelatin as well.", "Some ideas: blue gelatin with red flashing strobe light lime gelatin with red flashing strobe light layered gelatin mold of red, green, and yellow gelatin with lights under it Halloween Flies Last year there was a similar thread with lots of fun ideas.", "One I remember was  inserting almond slivers into black raisins to make \"flies\", which you suspend  in orange Jello."
)

c("Cut pineapples in half lengthwise, leaving top with leaves attached if you wish  to serve it the pineapple shell.", "Remove most of the pineapple from the halves,  in one piece if possible, using a paring knife and grapefruit knife.  Cut the  pineapple inside piece in half lengthwise and cut out the core.  Cut in half  lengthwise again and then cut each piece into 2.", "(You should end up with about  8 long slices from each pineapple.) In a small bowl, combine brown sugar with  cinnamon and nutmeg.", 
"Toss half this mixture with the pineapple. Peel bananas  just before cooking, cut in half crosswise and lengthwise.   Toss with remaining sugar.", "Barbecue pineapple or broil until browned and partially cooked, about 8  to 10 minutes.", "Cook bananas until browned, about 5 minutes.", "Serve \"sticks\" of  pineapple and bananas in pineapple shells with a scoop  of sorbet.  NOTE: If you are not serving it in the shells, buy the  pineapple already peeled and cored.", "It can be cut into rounds or sticks."
)

c("Remove papery husks from tomatillos.", "Wash tomatillos and chiles well.", "Cook, covered, in a little boiling water  until tender, about 15 minutes.", "Remove stems and  seeds from chiles.", "Place chiles and drained tomatillos  in blender container.", "Add onion, garlic and cilantro and blend until pureed.", "Heat 2 tablespoons oil in a large skillet, add pureed mixture and fry, adding soda and sugar.   Salt to taste.", "When mixture is cooked, add White Sauce, cream and 1/2 cup cheese.", "Season with salt & pepper to taste; keep hot.", 
"For each serving, soften 3 tortillas in hot oil, then dip in hot sauce. Place some shredded chicken on each tortilla and roll.   Place, seam side down, in individual baking dishes.", "Cover with remaining sauce and sprinkle cheese over top.", "Place under broiler until cheese melts  and is golden brown.", "WHITE SAUCE: Melt butter, add onion and garlic and cook until onion  is browned.", "Stir in flour and cook and stir until flour is cooked.", "Add milk and cook until thickened.", "Strain sauce, then add Worcestershire and salt and pepper to  taste. I have enjoyed this dish at Sanborns House of Tiles in Mexico."
)

c("* For each cup of fruit you will need 1-1/2 tablespoons of sugar.", "Chop peaches, nectarines or plums very fine, being careful to reserve the juice. Place fruit and its juices in saucepan and bring to a boil.", "Boil until candy  thermometer reads 180 degrees.", "Cool slightly.", "Put into blender and mix until  smooth.", "Return to heat and cook until the mixture has the consistency of a thick paste and is reduced by half.", "Spread fruit 1/4-inch thick on plastic-wrapped  trays or cookie sheets.", 
"Cover pans with a cheesecloth screen, taking care to  keep the cheesecloth from touching fruit. Place in direct sunlight for 12 to 24  hours until dry (bring in at nighttime). You can also bake in a 250-degree oven  for about 4 hours.", "Put the fruit on a lightly greased cookie sheet or use foil  to line tray.", "Fruit rollups are done when edges pull back from plastic and  center is not sticky when cooled.", "Ten cups of fruit will cover a 12 x 17-inch  tray.", "- - - - - - - - - - - - - - - - - -  Serving Ideas : Make dried fruit roll-ups the old-fashioned way."
)

c("CRUST     Roll out chocolate cream wafers on wax paper.", "Mix crumbled wafers,  butter and nuts in the bottom of a 10\" spring form pan.", "Using a piece of wax paper, press mixture evenly in the bottom of the pan.", "Place pan in refrigerator or freezer while preparing the filling.", "FILLING     Preheat oven to 350 degrees.", "In a large bowl beat cream cheese until fluffy.", "Gradually add sugar.", "Beat in eggs one at a time until well blended.", "Stir in chocolate and vanilla.", "Mix well.", 
"Pour on top of  prepared crust and bake 50 minutes.", "Remove from oven.", "Turn oven off and close door.", "TOPPING     Combine sour cream, sugar and vanilla.", "Spread over cheesecake.   Return to oven, but do not reheat oven.", "Leave in warm oven for 10 minutes with the door closed.", "Open door and leave cake in oven for an additional 20 minutes.", "Remove cake from oven.", "Allow cake to cool on wire rack.", "FINAL TOUCH     Freeze Hershey bar.", "When cake is cooled, shave frozen chocolate on  top of cake.  Refrigerate overnight."
)

c("Preheat the oven to hot (425F/220C/Gas 7)", "Put a teaspoonful of oil or  dripping in each of several muffin tins or, to be truly Yorkshire, a couple of  tablespoonsful in a larger roasting tin and place in the oven until the fat is  really hot and beginning to smoke.  Meanwhile combine the rest of the  ingredients and beat to form a batter of the consistency of double cream.", "If  you wish you can add mixed dried herbs to add a savoury flavour.", "When the fat  is smoking take the tin out of the oven and place it over a low light so that it doesn't cool as you add the batter.", 
"Pour in the batter If you're using muffin  tins don't over fill.", "Remember that the puddings will rise and puff up.", "Put  the tin back into the top of the oven as soon as possible and leave for about  20-25 minutes by which time they will be puffed up and crisp.", "When my  grandmother used to make Yorkshire pudding to go with the Sunday  roast we would eat it in the true Yorkshire way.", "That is, as a first course with just a  savoury gravy poured over it.  After all, the idea of Yorkshire pudding is to  fill you up so that you don't want so much of the more expensive meat!  If there was any of the pudding left over as a treat we  kids would have it as a desert  with Golden Syrup poured over it. Servings: 4 Ian Rice (Yorkshireman)"
)

c("Cook the beans over gentle heat for 45 minutes or an hour at the most (an hour-and-a-half if they are dried, after soaking in water, together with the herbs and garlic, for a couple of hours). In either case, do not add salt which tends to harden the skins.", "Puree by putting through a vegetable mill, carefully eliminating the husks.", "Put the garlic, rosemary, sage and cubed bacon to saute briefly in a saucepan with 4 tablespoons of oil.", "Pour on the bean puree. Season lightly with salt and the red hot pepper to taste. Stir to blend the flavours and bring slowly to the boil.", 
"Throw the pasta into the puree and cook until firm, diluting with a little of the bean cooking water, but only if necessary - the soup must be thick and rather solid.", "It is excellent hot, but is absolutely delicious if heated up with the addition of a drop of first-rate olive oil.", "If you prefer, leave a few beans whole and add them to the saucepan with the puree. Some cooks hold that a carrot is not out of place in the mirepoix (but then cut out the bacon), or that the soup loses nothing if you add a little tomato, even tomato concentrate (paste)."
)

c("Preheat oven to 375 degrees.", "In medium bowl, stir together flour, brown sugar and salt. With pastry blender, cut in butter until mixture resembles coarse meal.", "With fork, stir in cream and vanilla just until mixture begins to hold together.", "With hands, gently squeeze dough into loose clumps.", "Place on large sheet of plastic wrap; press clumps together to form a ball.", "Using the plastic wrap to keep edges from crumbling, roll into a 12-inch circle. Gently lift dough onto a 9-inch tart pan with removable bottom; fold edges over to make sides double thick, and press dough firmly into corners of pan.", 
"Line pastry with foil; fill with dry beans or pie weights.", "Place tart pan on baking sheet or pizza pan; bake 35 minutes.", "Turn off oven; carefully remove foil and beans.", "Use a fork to pierce pastry in 2 or 3 places; return to turned-off oven for 5 minutes.", "Let cool completely.", "In medium bowl, beat cream cheese with powdered sugar until smooth;.", "Beat in yogurt, extract and rum.", "Fill cooled pastry shell; chill.", "Drain pineapple well on paper towels; chill.", "Just before serving, garnish tart with pineapple and toasted coconut."
)

c("In a large bowl, sprinkle yeast over warm water (I add a pinch of sugar) and allow to set until it begins to foam, about 5 minutes.", "Stir in salt, oil and half of flour. Gradually add remaining flour, mixing well.", "Knead 8-10 minutes or until smooth and elastic. Place in greased bowl and let rise until double (1/2-1 hour) Punch down and let rise again until double. Punch down and divide. Pat out on two pizza pans.", "Top with pizza sauce & toppings. Bake at 400 degrees for 20-25 minutes.", 
"Pizza Sauce:  Mix all ingredients together, blending well. (You can also add a few sprinkles of garlic powder if you want).", "Makes enough for two 12- or14-inch pizzas or one thick 16-inch pizza.", "Top with meats, cheese and other toppings.", "To freeze, prepared pizza method: double wrap and freeze the prepared pizza (without baking it) on the pizza pan. Unwrap and bake the frozen pizza at 400째F for about 22 minutes.", "Alternative freezing method: after first punch down of dough, divide dough and place in a zip-loc bag and place in the freezer. To prepare, remove from freezer and place in a greased bowl. The dough will take about 8-10 hours to thaw and raise slightly. Pat out on grease pizza pan and proceed as directed above. I also freeze half the sauce in a small container for future use."
)
